import style from "./InitialPage.module.scss";
import { BoxesMenuItem } from "./BoxesMenuItem/BoxesMenuItem";

const InitialPage = () => {
  return (
    <div className={style.boxesContainer}>
      <BoxesMenuItem textContent="Повторить слова" imgContent="people_2.png" />
      <BoxesMenuItem textContent="Словарь" imgContent="people_1.png" />
      <BoxesMenuItem textContent="Алфавит" imgContent="people_3.png" />
      <BoxesMenuItem textContent="Грамматика" imgContent="people_2.png" />
    </div>
  );
};

export { InitialPage };
